import * as helper from './helper.js';
/* single page app (monkeytesting) */

let monkeyTestingEnabled = false;

var GUIcontrols = new function () {
	this.map = "Map";
	this.mode = "NCEP";
	this.partitions = 8;
	this.pressure = 5;
	this.timeslice = 0;
	this.numSteps = 50;
	this.numSeeds = 5;
	this.seedsShownAtOnce = 500;
	this.monkeyTest = false;
};

var transformTo;
var transformFrom;
var jobLoc;

class VCI_APP extends HTMLElement {
	constructor() {
		super();
		this.root = this.attachShadow({ mode: 'open' });

		this.service = new VCI(["http://" + location.host]);
		this.imgs = "/static/images";
		
		const [width, height] = helper.getWindowSize()
		this.width = Math.floor(width);
		this.height = height;

		window.app = this;

		this.setup();
		this.start();
		this.epilogue();
	}

	start() {
		let value = GUIcontrols.map;

		this.clearScene();
		if (value === "Globe") {
			this.init = this.initGlobe;
		} else if (value === "Map") {
			this.init = this.initMap;
		}

		value = GUIcontrols.mode;
		if (value === "Test1") {
			jobLoc = "service/job/streamline";
			transformTo = helper.transformToStreamline;
			transformFrom = helper.transformFromStreamline;
		} else if (value === "NCEP") {
			jobLoc = "service/job/ncar";
			transformTo = helper.transformToNcar;
			transformFrom = helper.transformFromNcar;
		}

		this.init();
		this.render();

		if (monkeyTestingEnabled) {
			this.monkeyTesting();
		}
	}

	setup() {
		const renderer = new THREE.WebGLRenderer({ antialias: true });
		renderer.setSize(this.width, this.height);
		this.root.appendChild(renderer.domElement);
		renderer.domElement.setAttribute('style', 'float: left; overflow: hidden; box-sizing: border-box;outline: none; border: none; overflow: hidden; display: block;');

		const camera = new THREE.PerspectiveCamera(60, this.width / this.height, 0.1, 1000);
		camera.position.set(0, 0.001, 13);
		camera.up.set(0, 0, 1);

		const controls = new THREE.OrbitControls(camera, renderer.domElement);
		controls.enableDamping = true;
		controls.dampingFactor = 0.05;
		controls.enableKeys = false;

		const scene = new THREE.Scene();

		const raycaster = new THREE.Raycaster();
		const mouse = new THREE.Vector2(-1, -1);
		const prevMouse = new THREE.Vector2(-1, -1);
		const pressed = false;

		const streamlines = [];

		const mode = 'Rotate';

		const light = new THREE.DirectionalLight(0xffffff, 0.3);
		scene.add(light);
		scene.add(new THREE.AmbientLight(0xaaaaaa, 0.7));

		Object.assign(this, { renderer, camera, controls, scene, mouse, prevMouse, pressed, raycaster, mode, streamlines, light });

		this.configCallbacks();	//mouse event listener callbacks
		this.setupHTML();
	}

	epilogue() {
		if(!window.location.hash) return;
		
		let hash = window.location.hash.substring(1);
		if(hash != "monkey") return;
		monkeyTestingEnabled = true;
		this.monkeyTesting();
	}

	configCallbacks() {
		const { renderer, mouse, camera } = this;
		this.addEventListener('mousemove', (e) => {
			const rect = renderer.domElement.getBoundingClientRect();
			mouse.x = ((e.clientX - rect.left) / rect.width) * 2 - 1;
			mouse.y = -((e.clientY - rect.top) / rect.height) * 2 + 1;
		}, { useCapture: true });
		this.addEventListener('mousedown', (e) => {
			this.pressed = true;
			this.mode = this.mouseOverMesh() ? 'Draw' : 'Rotate';
		});
		this.addEventListener('mouseup', (e) => {
			this.pressed = false;
			this.mode = 'None';
		});
		window.addEventListener('resize', function onWindowResize() {

			const [width, height] = helper.getWindowSize();
			this.width = Math.floor(width);
			this.height = height;
			camera.aspect = this.width / this.height;
			camera.updateProjectionMatrix();
			renderer.setSize(this.width, this.height);
		}, false);
	}

	setupHTML() {
		let gui = new dat.GUI();
		var mapMode = gui.add(GUIcontrols, 'map', ["Globe", "Map"]).name("Model");
		var appMode = gui.add(GUIcontrols, 'mode', ["Test1", "NCEP"]).name("Data");
		//gui.add(GUIcontrols, 'partitions', 1, 20).step(1);
		gui.add(GUIcontrols, 'pressure', 0, 10).step(1).name("Seed Pressure");
		gui.add(GUIcontrols, 'timeslice', 0, 500).step(1).name("Seed Time");
		gui.add(GUIcontrols, 'numSteps', 2, 1000).step(1).name("nSteps/Trace");
		gui.add(GUIcontrols, 'numSeeds', 1, 10).step(1).name("nSeeds/Req");
		gui.add(GUIcontrols, 'seedsShownAtOnce', 0, 2000).name("MaxTraceShown");
		let monkeyTest = gui.add(GUIcontrols, 'monkeyTest');

		monkeyTest.onChange(this.monkeyTesting.bind(this));
		//console.log(monkeyTest);
		let checkbox = monkeyTest.domElement.children[0];
		checkbox.id = "TheMankeyButton";

		appMode.onChange(this.start.bind(this));
		mapMode.onChange(this.start.bind(this));
		gui.close();
	}

	initGlobe() {

		const { scene } = this;

		const geometry = new THREE.SphereBufferGeometry(6.0, 64, 64);
		const material = new THREE.MeshPhongMaterial({ //have to use phong material cuz standardMaterial doesn't have a specular
			map: new THREE.TextureLoader().load(`${this.imgs}/earth.jpg`),
			specularMap: new THREE.TextureLoader().load(`${this.imgs}/earth-specular.png`),
			bumpMap: new THREE.TextureLoader().load(`${this.imgs}/earth-bump.jpg`),
			bumpScale: 0.5
		});
		const mesh = new THREE.Mesh(geometry, material);
		mesh.rotation.y = 180 * Math.PI / 180;
		mesh.rotation.x = 90 * Math.PI / 180;
		scene.add(mesh);

		const group = new THREE.Group();
		group.position.set(0, 0, 0);
		scene.add(group);

		Object.assign(this, { mesh, group /*, ctx, texture*/ });

		this.render();
	}

	initMap() {
		const { scene } = this;

		const group = new THREE.Group();
		group.position.set(0, 6, 0);
		if (GUIcontrols.mode === "Test1") {
			group.scale.set(-.069 * Math.PI / 2, -.0335, 1 / 500);
		} else if (GUIcontrols.mode === "NCEP") {
			group.scale.set(-.069 * Math.PI / 2, -.0335, 1 / 10);
		}
		scene.add(group);

		const geometry = new THREE.PlaneGeometry(12, 12);
		const material = new THREE.MeshPhongMaterial({ //have to use phong material cuz standardMaterial doesn't have a specular
			map: new THREE.TextureLoader().load(`${this.imgs}/earth.jpg`),
			specularMap: new THREE.TextureLoader().load(`${this.imgs}/earth-specular.png`),
			bumpMap: new THREE.TextureLoader().load(`${this.imgs}/earth-bump.jpg`),
			bumpScale: 0.5
		});
		const mesh = new THREE.Mesh(geometry, material);
		mesh.rotation.z = 180 * Math.PI / 180;
		mesh.scale.set(Math.PI / 2, 1, 1);
		scene.add(mesh);

		Object.assign(this, { mesh, group });
	}

	clearScene() {
		const { scene } = this;
		if (scene && scene.children) {
			let i = 0;
			while (scene.children.length > 2) {
				if (scene.children[i].type == "DirectionalLight" || scene.children[i].type == "AmbientLight") {
					++i;
					continue;
				}
				scene.remove(scene.children[i]);
			}
		}
	}

	async getStreamlines(oseeds, force=false) {
		const request = { partitions: GUIcontrols.partitions, hostid: 0, seeds: oseeds, steps: GUIcontrols.numSteps };
		await this.service.postData({
			url: false, //observation
			loc: jobLoc,
			data: request,
			callback: this.renderStreamline.bind(this),
			multiHost: true
        }, 0x66c2a5, force).catch(err => console.log(err));
	}

	async getStreamlinesFromMouse(uv) {
		let requests;

		if (GUIcontrols.map === "Globe") {
			requests = [].concat(...helper.seedsOnSphere(uv.x, 1 - uv.y, GUIcontrols.pressure, GUIcontrols.numSeeds));
		} else if (GUIcontrols.map === "Map") {
			const x = helper.interpolate(0, 1, -90, 90, uv.x);
			const y = helper.interpolate(0, 1, 0, 360, uv.y);
			requests = [].concat(...helper.seedsAroundPoint(x, y, GUIcontrols.pressure, GUIcontrols.timeslice, 1, GUIcontrols.numSeeds));
		}
		if (transformTo) requests = transformTo(requests);
		await this.getStreamlines(requests);
	}

	renderStreamline(response, color) {

		const { scene, streamlines, group } = this;
		const points = response.points;

		let transform = transformFrom;

		for (let i = 0; i < points.length; ++i) {

			let curve = new THREE.CatmullRomCurve3();
			let curvepoints = [];
			curvepoints.push(new THREE.Vector3(0, 0, 0));
			const numVerts = points[i].length;

			let totalLength = 0;

			const stepsize = jobLoc === "service/job/ncar" ? 4 : 3;
			for (let j = 0; j < numVerts; j += stepsize) {

				let lat, lon, prs, sec;
				if (transform) {
					[lat, lon, prs, sec] = transform(points[i], j);
				} else {
					lat = points[i][j + 0];
					lon = points[i][j + 1];
					prs = points[i][j + 2];
					sec = points[i][j + 3];
				}

				let newVert;
				if (GUIcontrols.map === "Globe")
					newVert = new THREE.Vector3(...helper.toxyz(lat, lon, prs, sec));
				else
					newVert = new THREE.Vector3(lat, lon, prs);

				let length = curvepoints[curvepoints.length - 1].distanceTo(newVert);

				if (length > .001) {
					curvepoints.push(newVert);
					totalLength += length;
				}
			}

			curvepoints.shift();
			if (curvepoints.length <= 1) continue;

			curve.points = curvepoints;
			let radius = GUIcontrols.map === "Globe" ? .015 : .15;
			const fidelity = GUIcontrols.map === "Globe" ? 1 : 10;

			let segments = Math.round(totalLength / fidelity);
            let geometry = new THREE.TubeGeometry(curve, segments, radius, 3, false);

			let material = new THREE.MeshStandardMaterial({color});
			let tube = new THREE.Mesh(geometry, material);

			streamlines.push(tube);
			group.add(tube);

			/* setTimeout(() => {
				group.remove(streamlines.shift());
			}, GUIcontrols.timeOut * 1000); */

			while(streamlines.length > GUIcontrols.seedsShownAtOnce)	group.remove(streamlines.shift());
		}
	}

	mouseOverMesh() {
		const { raycaster, mouse, camera, mesh } = this;
		raycaster.setFromCamera(mouse, camera);
		const intersects = raycaster.intersectObject(mesh);
		return intersects.length === 0 ? false : intersects;
	}

	render() {
		const { mouse, prevMouse, pressed, camera, texture, ctx, raycaster, mesh, controls, mode, light } = this;
		light.position.copy(camera.position);
		
		const intersects = this.mouseOverMesh();
		
		if(monkeyTestingEnabled)
			this.renderMouseInput();

		if (intersects) {
			const uv = intersects[0].uv;

			if (prevMouse.distanceTo(mouse) > 0.01) {
				prevMouse.copy(mouse);
				this.getStreamlinesFromMouse(uv);
			}
		}

		controls.update();
		requestAnimationFrame(this.render.bind(this));
		this.renderer.render(this.scene, this.camera);

	}

	async monkeyTesting() {
let rec = JSON.parse(atob(""));

		function sleep(ms) {
			return new Promise(resolve => setTimeout(resolve, ms));
		}
		const [width, height] = helper.getWindowSize()

		for (let i = 0; i < rec.length; ++i) {
			
			let uv = {x: helper.interpolate(0, width, -1, 1, rec[i].pos[0]), y: helper.interpolate(0, height, -1, 1, rec[i].pos[1])};
			let waitTime = rec[i].delay;
			this.mouse = uv;
			await sleep(waitTime);
			console.log("Did test: ", i, ": (",uv ,")");
		}
		console.log("FINISHED MONKEY");


	}
	
	renderMouseInput(){
		++count;
		if(count < 300)	return;
		let {x,y} = this.mouse;
		x = (x+1)/2;
		y = (y+1)/2;
		let body = document.getElementsByTagName("body")[0];

		const [width, height] = helper.getWindowSize()

		x *= width;
		y = (1-y)*height;

		let div = document.createElement('div');
		div.style.width = "25px";
		div.style.height = "25px";
		div.style.position = "fixed";
		div.style.top = (y-25/2)+"px";
		div.style.left = (x-25/2)+"px";
		div.style.borderRadius = "50%";
		div.style.transition = "opacity 1s";
		div.style.backgroundImage = "radial-gradient(closest-side at 50% 50%, rgba(255,0,0,0.5) 0%, rgba(255,0,0,0))";
		body.appendChild(div);

		/*
		setTimeout(function(){div.style.opacity = "0";}, 0);
		setTimeout(function(){div.parentNode.removeChild(div);}, 1000);
		*/
	}
};
customElements.define('vci-viewer', VCI_APP);


var count = 0
